import './App.css';
import Navbar from './components/Navbar'
import {useState} from 'react'

function App() {
  let [data,setData]=useState([]);

  let getData=()=>{
    let response = fetch('http://127.0.0.1:8000/api/workers/')
    let data = response.json()
    return data
  }

  let dump = getData()
  console.log("Dump: ", dump)



  return (
    <div className="container">
      <Navbar />
      <h1>Hello wolrd!</h1>
    </div>
  );
}

export default App;
